import axios from "axios";
import React, { useEffect, useState } from "react";
function EarlyAccess() {
const [Count,setCount] = useState(0);


// på hver re-render så oppdateres antall registrerte ved hjelp av post forespørsel og useState funksjon
useEffect( () => {
  axios.get("https://learnreflects.com/Server/get_user_count.php") 
  .then(response => setCount(response.data.Count))
  .catch(err => console.log(err));
})

return(
  <div className="EarlyAccess-Count">
  <span>
  Join {Count} + others in getting early access!
  </span>
  </div>
);
}

export default EarlyAccess;
